svg.script:
webMI.data.subscribe(webMI.query["base"] + ".current_flow", function(e) {
var id = "id_38";
var value = e.value;
webMI.gfx.setText(id, webMI.sprintf("%.1f", value));

});


webMI.data.subscribe(webMI.query["base"] + ".name", function(e) {
var id = "id_6";
var value = e.value;
webMI.gfx.setText(id, value);

});
webMI.data.subscribe(webMI.query["base"] + ".diameter", function(e) {
var id = "id_7";
var value = e.value;
webMI.gfx.setText(id, value);

});
webMI.data.subscribe(webMI.query["base"] + ".current_flow", function(e) {
var id = "id_3";
var status = e.status;
var value = e.value;

if (status == 0 && value > 1){
	webMI.gfx.setFill(id, "#2c99d8");
	}
	else {
	webMI.gfx.setFill(id, "#d5d5d5");

	}
});
webMI.data.subscribe(webMI.query["base"] + ".current_flow", function(e) {
var id = "id_0";
var status = e.status;
var value = e.value;

if (status == 0 && value > 1){
	webMI.gfx.setFill(id, "#2c99d8");
	}
	else {
	webMI.gfx.setFill(id, "#d5d5d5");

	}
});







webMI.addEvent("id_21", "click", function(e) {
var id = "id_21";
var value = true;
webMI.display.openWindow({display:"",extern:false,height:100,menubar:false,modal:false,movable:false,resizable:false,scrollbars:false,status:false,title:"",toolbar:false,width:100});
});
webMI.data.subscribe(webMI.query["base"] + ".host_name", function(e) {
var id = "id_2";
var value = e.value;
webMI.gfx.setText(id, value);

});
